export default function Page () {
    return (
        <>
        <div className="card-img"></div>
        <img src={image} alt={title} />

        <p>Forg et choosing what university you want to study at, choosing a sushi roll is where the real stress is at. Seriously, I struggle more with deciding between a California and Spicy Tuna Roll than I ever did with choosing between St. Andrews and Durham (sorry, Durham, we know who won that battle). Whether you pick your roll based on calorie count or what sushi roll fits your personality, the decision is always tricky. Luckily, I've compiled a ranking of the best classic sushi rolls so that you never have to overthink it again.</p>
        </>

    )
}
